import CountriesModel from "../models/domian/CountriesModel";
import {CountryInfo} from "../../api/apiService";
import {inject} from "mobx-react";
import Models from "../models";
export default class AutocompleteControlViewModel {
  private countriesModel: CountriesModel;


  constructor(countries: CountriesModel) {
    this.countriesModel = countries;
  }

  public async getSearchCountriesAsync(value: string) {
    console.log(value)
    await this.countriesModel.getSearchCountriesAsync(value);
  }


  public get foundCountriesList(): CountryInfo[] | undefined {
    return this.countriesModel.foundCountries();
  }

  public get asyncLoading(): boolean {
    return this.countriesModel.asyncLoading;
  }
}
